import React from 'react';
import './CaseStudySolution.css';

function CaseStudySolution({ title, description1, description2, image }) {
  return (
    <section className="solution-section">
      <h3 className="solution-label">SOLUTION</h3>
      <div className="solution-content">
        <div className="solution-text">
          <h2 className="solution-title">{title}</h2>
          <p>{description1}</p>
          <p>{description2}</p>
        </div>
        <div className="solution-image">
          <img src={image} alt="Digital Styleguide" />
        </div>
      </div>
    </section>
  );
}

export default CaseStudySolution;
